function addItem() {
  const container = document.getElementById("unitsContainer");
  const div = document.createElement("div");
  div.classList.add("unit");
  div.innerHTML = `
    <input type="text" class="description" placeholder="Description">
    <input type="number" class="quantity" placeholder="Qty">
    <input type="number" class="rate" placeholder="Rate (AED)">
    <button class="removeItem" onclick="this.parentElement.remove()">X</button>
  `;
  container.appendChild(div);
}

async function generateInvoice() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const logo = "data:image/png;base64,";

  const signatureBase64 = "data:image/png;base64,"; // Replace with your real Base64 image

  const bottom = "data:image/png;base64,"; // Replace with your real Base64 image

  doc.addImage(logo, "PNG", 10, 10, 56, 30);
  doc.setFont("helvetica", "bold");
  doc.setFontSize(14);
  doc.text("HOME HARMONY", 65, 15);
  doc.setFontSize(10);
  doc.setFont("helvetica", "normal");
  doc.text("BUILDINGS MAINTENANCE SERVICES", 65, 21);
  doc.text("Phone: +971 54 2414054", 65, 26);
  doc.text("Email: mail2rana.khalid@gmail.com", 65, 31);
  doc.text("Office #, Al Dana, East, 11 0: ~, Building, Al Khazna Insurance Company", 65, 36);

  doc.setFillColor(0, 150, 200);
  doc.rect(10, 45, 190, 12, "F");
  doc.setTextColor(255, 255, 255);
  doc.setFontSize(13);
  doc.setFont("helvetica", "bold");
  doc.text("HOME HARMONY BUILDINGS MAINTENANCE INVOICE", 15, 53);

  const name = document.getElementById("name").value;
  const phone = document.getElementById("phoneNumber").value;
  const invoice = document.getElementById("INVOICENumber").value;
  const dateInput = document.getElementById("invoiceDate").value;
  const invoiceDate = dateInput
    ? new Date(dateInput).toLocaleDateString("en-GB", { day: "2-digit", month: "short", year: "numeric" })
    : new Date().toLocaleDateString("en-GB", { day: "2-digit", month: "short", year: "numeric" });
  const advance = parseFloat(document.getElementById("advance").value) || 0;

  doc.setFontSize(11);
  doc.setTextColor(0, 0, 0);
  doc.text(`Invoice #: ${invoice}`, 15, 65);
  doc.text(`Customer: ${name}`, 15, 71);
  doc.text(`Phone: ${phone}`, 15, 77);
  doc.text(`Invoice Date: ${invoiceDate}`, 130, 65);

  const items = [];
  let subtotal = 0;

  document.querySelectorAll(".unit").forEach(unit => {
    const desc = unit.querySelector(".description").value;
    const qty = parseFloat(unit.querySelector(".quantity").value) || 0;
    const rate = parseFloat(unit.querySelector(".rate").value) || 0;
    const total = qty * rate;
    subtotal += total;
    items.push([desc, qty, rate.toFixed(2), total.toFixed(2)]);
  });

  if (items.length === 0) return alert("Add at least one item");

  const gst = subtotal * 0.00;
  const grandTotal = subtotal + gst;
  const balance = grandTotal - advance;

  doc.autoTable({
    startY: 85,
    head: [["Description", "Qty", "Rate (AED)", "Total (AED)"]],
    body: items,
    columnStyles: {
      0: { cellWidth: 90 },
      1: { cellWidth: 20, halign: "center" },
      2: { cellWidth: 30, halign: "right" },
      3: { cellWidth: 35, halign: "right" }
    },
    headStyles: {
      fillColor: [0, 51, 153],
      textColor: [255, 255, 255],
      fontStyle: "bold",
    },
    styles: {
      fontSize: 10,
      lineColor: [0, 102, 204],
      lineWidth: 0.5,
    },
    alternateRowStyles: { fillColor: [245, 245, 245] }
  });

  const finalY = doc.lastAutoTable.finalY + 10;
  doc.setFont("helvetica", "bold");
  doc.setTextColor(0, 51, 153);
  doc.setFontSize(11);
  doc.text(`Subtotal: AED ${subtotal.toFixed(2)}`, 130, finalY);
  doc.text(`VAT (5%): AED ${gst.toFixed(2)}`, 130, finalY + 7);
  doc.text(`Total:         AED ${grandTotal.toFixed(2)}`, 130, finalY + 14);
  doc.text(`PAID:          AED ${advance.toFixed(2)}`, 130, finalY + 21);
  doc.text(`__________________________`, 130, finalY + 23);
  doc.text(`DU Balance: AED ${balance.toFixed(2)}`, 130, finalY + 28);

  // Signature Image
  doc.addImage(signatureBase64, "PNG", 140, finalY + 40, 50, 25);
  doc.setFontSize(10);
  doc.setTextColor(100, 100, 100);
  doc.text("Authorized Signature / Stamp", 142, finalY + 68);
   // bottom Image
  doc.addImage(bottom, "PNG", 1,220, 208, 75);
  // Thank you message
  doc.setTextColor(34, 139, 34);
  doc.setFontSize(12);
  doc.text("Thank you for choosing Home Harmony!", 15, finalY + 80);

  const blob = doc.output("blob");
  const file = new File([blob], "invoice.pdf", { type: "application/pdf" });

  if (navigator.share) {
    try {
      await navigator.share({
        title: "Invoice",
        text: `Invoice for ${name}`,
        files: [file],
      });
    } catch (e) {
      downloadPDF(blob);
    }
  } else {
    downloadPDF(blob);
  }
}

function downloadPDF(blob) {
  const url = URL.createObjectURL(blob);
  const a = document.createElement("a");
  a.href = url;
  a.download = "invoice.pdf";
  document.body.appendChild(a);
  a.click();
  document.body.removeChild(a);

}
